import React from "react";
import "./App.css";

export const Box = () => {
    return (
        <div className="box">
            <div className="BG-circles">
                <div className="ellipse" />
                <div className="div" />
                <div className="ellipse-2" />
                <div className="ellipse-3" />
                <div className="ellipse-4" />
                <div className="ellipse-5" />
            </div>
        </div>
    );
};
